// SPDX-License-Identifier: MIT

pragma solidity ^0.8.12;

import {Position, OrderInfo, OrderType, ConfirmInfo} from "../../constants/Structs.sol";

interface IPositionHandler {
    function addOrRemoveCollateral(
        address _account,
        address _indexToken,
        bool _isLong,
        uint256 _posId,
        bool _isPlus, 
        uint256 _collateralAmount, 
        uint256 _amountOutMin,
        address[] memory _collateralPath
    ) external;

    function addPosition(
        address _account,
        address _indexToken,
        bool _isLong,
        uint256 _posId,
        uint256 _collateralDelta,
        uint256 _sizeDelta
    ) external;

    function addTrailingStop(
        address _account,
        address _indexToken,
        bool _isLong,
        uint256 _posId,
        uint256[] memory _params
    ) external;

    function cancelPendingOrder(
        address _account, 
        address _indexToken, 
        bool _isLong, 
        uint256 _posId
    ) external;

    function closePosition(
        address _account,
        address _indexToken,
        bool _isLong,
        uint256 _posId,
        uint256 _sizeDelta
    ) external;

    // function increasePosition(
    //     address _account,
    //     address _indexToken,
    //     uint256 _amountIn,
    //     uint256 _sizeDelta,
    //     uint256 _posId,
    //     bool _isLong,
    //     uint256[3] memory _prices
    // ) external;

    function getPosition(
        address _account,
        address _indexToken,
        bool _isLong,
        uint256 _posId
    ) external view returns (Position memory, OrderInfo memory, ConfirmInfo memory);

    function getPosition(bytes32 _key) external view returns (Position memory);

    function getOrder(bytes32 _key) external view returns (OrderInfo memory);

    function poolAmounts(address _token, bool _isLong) external view returns (uint256);

    function reservedAmounts(address _token, bool _isLong) external view returns (uint256);

    function lastPositionIndex(address _account) external view returns (uint256);

    function openNewPosition(
        bytes32 _key,
        address _indexToken,
        bool _isLong, 
        uint256[] memory _params,
        uint256[] memory _prices,
        bytes memory _data
    ) external;
}

